import React from 'react';
import projectData from "../projectData.js";
import ProjectPreview from "./ProjectPreview.jsx";

function Portfolio({ mobileSm, mobileLg, tabletSm, tabletLg, desktopSm, desktopLg }) {

	return (
		<div className="portfolio container">

			{projectData.map((project) => {
				<ProjectPreview 
				key={project.heading}
  			project={project}
  			mobileSm={mobileSm}
    		mobileLg={mobileLg}
	    	tabletSm={tabletSm}
	    	tabletLg={tabletLg}
	    	desktopSm={desktopSm}
	    	desktopLg={desktopLg} />
				})
			}

		</div>
	)
}

export default Portfolio;
